\f0\fs34 \cf1 \kerning1\expnd12\expndtw64
When the sun goes down and one stands in the wood,\
where one sees the light break through the trunks like a red glow, one discerns the light above the trees, although like a half tone. \
To achieve this I would take a grey canvas and first show both the spot where the sun as and the shining clouds with pure kremser white in impasto, and then add the drawing and make white patch glow by glazing it with Rose madder and gummi gutae, Rose madder, Rose madder and burnt Siena, etc.; then use a green, made up of blue and dark ochre; where the shadows are, somewhat blueish, an additional tint; draw the woods in front of that, glaze the light with a greenish-black mix and barely allow this and that to reach the light against the wood; draw everything with a pointed, stiff fine brush.}

