\f0\fs34 \cf1 \kerning1\expnd12\expndtw64
Overpainting the light would only be shadowed, the clouds that might be there half-filled on the light side, with a bluish violet colour, the wood with a cold blue reflective light and an accent on whatever jumps out; the gaps shooting between the trunks highlighted again in kremser white, while having already applied the haze that spreads around the sunbeams in the wood and around the trunks.\
Finally a clear, transparent glaze from the four corners of the painting, thinner and thinner up to the glow and glowingly shadowed where needed; and still before this in the second impasto underpainting, illuminate the light from its first appearance to the sun\'92s zenith.}

